def r2(input):
	# E(0123456789abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ) = 789abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456

	ciphered = list('789abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456')
	original = list('0123456789abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ')


	answer = ''
	for char in list(input):
		for i in range(len(ciphered)):
			if ciphered[i] == char:
				answer += original[i]
				break

	return (answer)



def r3(input):
	

	input_list = list(input)
	answer = ''

	order = list('0123456789abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ')
	for i in range(len(input_list)):

		for j in range(len(order)):
			if input_list[i] == order[j]:
				answer += order[ j - (i+1)]
				break
		

		

	return (answer)

