def r7(input):
	ciphertext = ''
	answer_dic = {}

	order_string = '0123456789abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ' 
	order = list(order_string)

	index = 0

	for i in range(len(order)):
		for j in range(len(order)):
			for k in range(len(order)):
				answer_dic[ciphertext[index : index+4]] = order[i] + order[j] + order[k]
				index += 4

	answer = ''


	index = 0
	while index < len(input):
		answer += answer_dic[input[index : index + 4]]
		index += 4

	
	return answer


def r8(input):
	with open('test.gz', 'wb') as w:
		s = input

		index = 0
		writebuffer = []
		while index < len(s):
			writebuffer.append(int( '0x' + s[index : index+2], 16))
			index += 2
		w.write(bytearray(writebuffer))


	call(["gzip", "-d", "test.gz"])

	answer = ''
	with open('test', 'r') as r:
		answer = r.readline().strip()

	call(["rm", "test"])
	return answer

